package com.example.test;

import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.io.TempDir;
import org.junit.jupiter.api.Assertions;

import org.apache.commons.configuration2.YAMLConfiguration;
import org.apache.commons.configuration2.ex.ConfigurationException;

import java.io.FileReader;
import java.io.IOException;
import java.nio.file.Files;
import java.nio.file.Path;
import java.util.Arrays;
import java.util.List;

public class YamlConfigurationParsingTest {

    @TempDir
    Path temporaryDirectory;

    String yamlContentString;
    YAMLConfiguration yamlConfiguration;

    @BeforeEach
    void setUp() throws IOException, ConfigurationException {
        // Step 1: Define YAML content with nested keys and list values
        yamlContentString = "key1: value1\n" +
                            "key2:\n" +
                            "  key3: value3\n" +
                            "key4:\n" +
                            "  - item1\n" +
                            "  - item2\n" +
                            "key5:\n" +
                            "  example:\n" +
                            "    - \"\"\n" +
                            "    - \"\"\n" +
                            "    - \"value\"\n";

        // Step 2: Instantiate a YAML Configuration object
        yamlConfiguration = new YAMLConfiguration();

        // Step 3 & 4: Create a temporary YAML file and write content to it
        Path yamlFilePath = temporaryDirectory.resolve("test_config.yaml");
        Files.write(yamlFilePath, yamlContentString.getBytes());

        // Step 5: Create a FileReader for the temporary YAML file
        FileReader fileReader = new FileReader(yamlFilePath.toFile());

        // Step 6: Load YAML content into the configuration from the FileReader
        yamlConfiguration.read(fileReader);
        fileReader.close(); // Close the reader after use
    }

    @Test
    void testYamlSequenceParsing() {
        // Step 7: Retrieve the property value for the nested key path \"key5.example\" from the loaded configuration
        Object retrievedPropertyValue = yamlConfiguration.getProperty("key5.example");

        // Step 8: Assert that the retrieved property value is a list containing two empty strings and one \"value\" string
        List<String> expectedList = Arrays.asList("", "", "value");
        Assertions.assertEquals(expectedList, retrievedPropertyValue);
    }
}

package org.apache.commons.configuration2.test;

import org.junit.jupiter.api.AfterEach;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.Assertions;

import org.apache.commons.configuration2.XMLConfiguration;
import org.apache.commons.configuration2.ex.ConfigurationException;
import org.apache.commons.configuration2.builder.fluent.Configurations;

import java.io.File;
import java.io.FileWriter;
import java.io.FileReader;
import java.io.IOException;
import java.nio.file.Files;
import java.nio.file.Path;
import java.util.Arrays;
import java.util.List;

public class XMLConfigurationHierarchicalEmptyValuesTest {

    private Path temporaryWorkspacePath;
    private Path settingsDocumentFile;
    private XMLConfiguration xmlConfigToSave;

    @BeforeEach
    void setUp() throws IOException, ConfigurationException {
        // Step 0: Establish a temporary workspace
        temporaryWorkspacePath = Files.createTempDirectory("configtest");

        // Step 1: Create a new XML configuration.
        xmlConfigToSave = new XMLConfiguration();

        // Step 2: Add properties to the XML configuration.
        // Adding the hierarchical property 'key5.example' with empty string values and then the final 'value'.
        // This step needs to be repeated for each empty string and the final 'value'.
        xmlConfigToSave.addProperty("key5.example", "");
        xmlConfigToSave.addProperty("key5.example", "");
        xmlConfigToSave.addProperty("key5.example", "value");

        // Step 3: Create a temporary file for the settings document.
        settingsDocumentFile = Files.createTempFile(temporaryWorkspacePath, "settings", ".xml");

        // Step 4: Create a FileWriter for the temporary settings file.
        FileWriter fileWriter = null;
        try {
            fileWriter = new FileWriter(settingsDocumentFile.toFile());

            // Step 5: Write the XML configuration to the temporary file.
            xmlConfigToSave.write(fileWriter);
        } finally {
            if (fileWriter != null) {
                fileWriter.close();
            }
        }
    }

    @Test
    void testHierarchicalEmptyValues() throws IOException, ConfigurationException {
        // Revised Steps 6, 7, 8: Load XML configuration using Configurations builder
        Configurations configs = new Configurations();
        XMLConfiguration xmlConfigToLoad = configs.xml(settingsDocumentFile.toFile());

        // Step 9: Retrieve the setting from the configured system at the nested path "key5.example"
        List<Object> retrievedSetting = xmlConfigToLoad.getList("key5.example");

        // Step 10: Assert that the retrieved setting is a sequence containing two empty text entries followed by the text "value"
        List<String> expected = Arrays.asList("", "", "value");
        Assertions.assertEquals(expected, retrievedSetting, "The retrieved setting should match the expected sequence including empty values.");
    }

    @AfterEach
    void tearDown() throws IOException {
        // Step 11: Clean up the temporary workspace
        if (settingsDocumentFile != null) {
            Files.deleteIfExists(settingsDocumentFile);
        }
        if (temporaryWorkspacePath != null) {
            Files.deleteIfExists(temporaryWorkspacePath);
        }
    }
}

package com.example;

import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.io.TempDir;
import org.junit.jupiter.api.Assertions;

import java.io.File;
import java.io.FileWriter;
import java.io.FileReader;
import java.util.Arrays;
import java.util.List;

import org.apache.commons.configuration2.YAMLConfiguration;

public class YamlConfigurationTest {

    @TempDir
    public File tempFolder;

    private final String testYamlContent = "key5:\n  example:\n    - \"\"\n    - \"\"\n    - \"value\"";

    private YAMLConfiguration yamlConfiguration;

    @BeforeEach
    void setUp() throws Exception {
        File yamlFile = new File(tempFolder, "test.yaml");
        try (FileWriter writer = new FileWriter(yamlFile)) {
            writer.write(testYamlContent);
        }

        yamlConfiguration = new YAMLConfiguration();
        yamlConfiguration.read(new FileReader(yamlFile));
    }

    @Test
    void testGetPropertyForList() {
        Object property = yamlConfiguration.getProperty("key5.example");
        List<String> expectedList = Arrays.asList("", "", "value");
        Assertions.assertEquals(expectedList, property);
    }
}
